import React, { useEffect, useState } from "react";
import Myheader from "./header";
import { Link } from "react-router-dom";

const MyResume = () => {
  let [pdata, updatPdata] = useState([]);
  let [ctcdata, updatCtcdata] = useState([]);
  let [edudata, updatEdudata] = useState([]);
  let [skldata, updatSkldata] = useState([]);
  const getPersonalData = () => {
    var url1 = "http://localhost:1240/personal";

    fetch(url1)
      .then((response) => response.json())
      .then((arrayPdada) => {
        updatPdata(arrayPdada);
      });
  };
  const getContactData = () => {
    var url2 = "http://localhost:1240/contact";

    fetch(url2)
      .then((response) => response.json())
      .then((arrayPdada) => {
        updatCtcdata(arrayPdada);
      });
  };
  const getEducationData = () => {
    var url3 = "http://localhost:1240/education";

    fetch(url3)
      .then((response) => response.json())
      .then((arrayPdada) => {
        updatEdudata(arrayPdada);
      });
  };
  const getSkillData = () => {
    var url4 = "http://localhost:1240/skills";

    fetch(url4)
      .then((response) => response.json())
      .then((arrayPdada) => {
        updatSkldata(arrayPdada);
      });
  };
  useEffect(() => {
    getPersonalData();
    getContactData();
    getEducationData();
    getSkillData();
    console.log(pdata);
  }, [1]);
  return (
    <div className="container mt-4 p-4 rounded">
      <div className="row mt-5">
        <div className="col-lg-12">
          <h2 className="text-center text-info">View Profile</h2>
        </div>
        <div className="col-lg-3">
          <div className=" text-primary">
            <ul className="list-group">
              <li className="list-group-item active ">Profile Setting</li>
              <Link to="/personal" className="list-group-item text-primary">
                <i className="fa fa-user"></i> Personal Details
              </Link>
              <Link to="/contact" className="list-group-item text-primary">
                <i className="fa fa-headset"></i> Contact Details
              </Link>
              <Link to="/education" className="list-group-item text-primary">
                <i className="fa fa-book"></i> Education Details
              </Link>
              <Link to="/skill" className="list-group-item text-primary">
                <i className="fa fa-desktop"></i> My Skills & Expeerience
              </Link>
              <Link to="/resume" className="list-group-item text-primary">
                <i className="fa fa-file"></i> My Resume
              </Link>
            </ul>
          </div>
        </div>
        <div className="col-lg-9 p-4 bg-white pt-4 shadow-lg">
          <div className="row">
            <div className="col-lg-4">
              <p>
                Full Name : <b></b>{" "}
              </p>
            </div>
            <div className="col-lg-4">
              <p>
                Mobile No : <b>{pdata[0].mobile}</b>
              </p>
            </div>
            <div className="col-lg-4">
              <p>
                e-Mail Id : <b>{pdata[0].email}</b>
              </p>
            </div>
            <div className="col-lg-4">
              <p>
                Total Work Experience :<p>{}</p>
              </p>
            </div>
            <div className="col-lg-4">
              <p>Tour Skills :</p>
            </div>
            <div className="col-lg-4">
              <p>Tenth Marks % :</p>
            </div>
            <div className="col-lg-4">
              <p>Twelth Marks % :</p>
            </div>
            <div className="col-lg-4">
              <p>Education :</p>
            </div>
            <div className="col-lg-4">
              <p>Passing Year :</p>
            </div>
            <div className="col-lg-4">
              <p>Marks :</p>
            </div>
            <div className="col-lg-4">
              <p>Current Address :</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MyResume;
